import React from "react";
import Menu from "./Menu";
import "./TopBar.css";

const TopBar = () => {
  return (
    <div className="topbar-container">
      <div className="indices-container">
        <div className="index-item nifty">
          <p className="index-name">NIFTY 50</p>
          <p className="index-points positive">22,100.20</p>
          <p className="index-change positive">+100.20 (0.45%)</p>
        </div>
        <div className="index-item sensex">
          <p className="index-name">SENSEX</p>
          <p className="index-points positive">73,150.80</p>
          <p className="index-change positive">+250.50 (0.34%)</p>
        </div>
      </div>

      <Menu />
    </div>
  );
};

export default TopBar;
